<div class="entities" style="line-height: 2.5; direction: ltr">Effects of external calcium on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . DB01373 is a known signalling molecule in eukaryotic cells and plays a central role in the regulation of many cellular processes . In the following study , we report on the effect of external calcium treatments on the biotransformation of DB06749 to ginsenoside Rd by Paecilomyces bainier 229-7 . We observed that the intracellular calcium content of P . bainier 229-7 mycelia was increased in response to exposure to high external Ca ( 2 + ) concentrations . Both ginsenoside Rd biotransformation and β-glucosidase activity were both found to be dependent on the external calcium concentration . At an optimal Ca ( 2 + ) concentration of 45 mM , maximal ginsenoside Rd bioconversion rate of 92.44 % was observed and maximal β-glucosidase activity of 0.1778 U was reached in a 72 - h biotransformation . The Ca ( 2 + ) channel blocker Verapamil blocked the trans-membrane influx of calcium and decreased ginsenoside Rd biotransformatiom . In addition , β-glucosidase activity and ginsenoside Rd content decreased by 36.0 and 29.2 % respectively after a 72 - h incubation in the presence of 0.05 mM P62158 ( P62158 ) antagonist

<div class="entities" style="line-height: 2.5; direction: ltr">Growth-inhibitory effects of vitamin D analogues and retinoids on human pancreatic cancer cells . Retinoids and vitamin D are important factors that regulate cellular growth and differentiation . An additive growth-inhibitory effect of retinoids and vitamin D analogues has been demonstrated for human myeloma , leukaemic and breast cancer cells . We set out to study the effects of the vitamin D analogue EB1089 and the retinoids all-trans - and 9 - cis-retinoic acid on the human pancreatic adenocarcinoma cell lines Capan 1 and Capan 2 and the undifferentiated pancreatic carcinoma cell line Hs766T . The cell lines investigated expressed vitamin D receptor , retinoic acid receptor ( RAR ) - alpha and gamma as determined by polymerase chain reaction after reverse transcription .

</mark>
 was expressed only in Hs766T cells . Addition of all-trans-retinoic acid increased the amount of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 mRNA in the three cell lines and induced 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10826

</mark>
 mRNA in Capan 1 and Capan 2 cells . All-trans-retinoic acid at a concentration of 10 nM inhibited the growth of Capan 1 and Capan 2 cells by 40 % relative to controls . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 was less effective . Neither all-trans-retinoic acid nor 9 - cis-retinoic acid affected the growth of Hs766T cells . EB1089 , if added alone to the cells , did not significantly inhibit growth . However , the combination of 1 nM EB1089 with 10 nM all-trans-retinoic acid exerted a growth-inhibitory effect of 90 % in Capan 1 cells and of 70 % in Capan 2 cells . Our data suggest that vitamin D analogues together with retinoids inhibit the growth of human pancreatic cancer cells . However , in vivo studies are necessary to examine the potential use of retinoids and vitamin D analogues on pancreatic cancer .</div>

 increased the cell cycle and cytotoxic effects of topotecan in multiple cell line models . Importantly , this sensitization occurred at veliparib concentrations far below those required to substantially inhibit poly ( ADP-ribose ) polymer synthesis and at least an order of magnitude lower than those involved in selective killing of homologous recombination-deficient cells . Further studies demonstrated that veliparib enhanced the effects of CPT in wild-type mouse embryonic fibroblasts ( MEFs ) but not Parp 1 ( - / - ) MEFs , confirming that

 ) . An examination of embryo brains 5 h after maternal poly ( I : C ) showed increased expression of

 , with reduced doublecortin and

 but no change in NFkB . Despite altered protein expression , there were no changes in the kynurenine pathway . The results show that maternal exposure to poly ( I : C ) alters the expression of proteins in the embryos and offspring which may affect the development of dopaminergic function . The oxidation of tryptophan along the kynurenine pathway is not involved in these effects .</div>
